import React from "react";
import API from "../utils/API";

const ViewStats = () => {

    const showData = (evt) => {
        evt.preventDefault();
        API.getStats().then(res => console.log(res.data))
        .catch(err => console.log(err));
    }

    return (
        <div>
            <h3>Player Stats</h3>
            <p>Player Name</p>
            <p>Wins</p>
            <button onClick={showData()}>Data</button>
        </div>
    )
}

export default ViewStats;
